    async Task OnSubmitProduct()
    {
        error = null;
        try
        {
            await ProductDataService.UpdateProduct(Id, saveProductDTO);
            toastService.ShowToast($"{saveProductDTO.ProductName} added Succesfuly", ToastLevel.Success);
